import BasicButton from "../comm/BasicButton";

const CalCalrorie2 = () => {
    return (
        <div className="flex py-20 space-x-20 justify-center ">
            <Button name="일별칼로리" color="orange" background="white"/>
            <Button name="주별칼로리" color="pink" background="white"/>
            <Button name="월별칼로리" color="blue" background="white"/>

        </div>
    );
}

export default CalCalrorie2
